import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import { GOOGLE_MAPS_API_KEY } from '../../config/maps';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './compareprediction.css';

const GOOGLE_MAPS_LIBRARIES = ['places', 'geometry'];

function loadGoogleMaps(apiKey) {
  if (!apiKey) {
    return Promise.reject(new Error('Missing Google Maps API key (set in src/config/maps.js or .env)'));
  }
  if (window.google && window.google.maps) {
    return Promise.resolve(window.google);
  }
  if (window._googleMapsPromise) {
    return window._googleMapsPromise;
  }
  const script = document.createElement('script');
  const libs = GOOGLE_MAPS_LIBRARIES.join(',');
  script.src = `https://maps.googleapis.com/maps/api/js?key=${apiKey}&libraries=${libs}`;
  script.async = true;
  script.defer = true;
  window._googleMapsPromise = new Promise((resolve, reject) => {
    script.onload = () => resolve(window.google);
    script.onerror = reject;
  });
  document.head.appendChild(script);
  return window._googleMapsPromise;
}

const DEFAULT_CENTER = { lat: 1.2868108, lng: 103.8545349 }; // SG center-ish

const PROPERTY_TYPES = [
  'Residential Property',
  'Commercial Property',
  'Industrial Property',
  'Mixed Development',
  'Landed Property'
];

const LEVEL_OPTIONS = [
  'Ground Floor',
  '1st Floor',
  '2nd Floor',
  '3rd Floor',
  '4th Floor',
  '5th Floor',
  '6th Floor',
  '7th Floor',
  '8th Floor',
  '9th Floor',
  '10th Floor',
  '11th Floor',
  '12th Floor',
  '13th Floor',
  '14th Floor',
  '15th Floor',
  '16th Floor',
  '17th Floor',
  '18th Floor',
  '19th Floor',
  '20th Floor',
  '21st Floor',
  '22nd Floor',
  '23rd Floor',
  '24th Floor',
  '25th Floor',
  '26th Floor',
  '27th Floor',
  '28th Floor',
  '29th Floor',
  '30th Floor',
  '31st Floor',
  '32nd Floor',
  '33rd Floor',
  '34th Floor',
  '35th Floor',
  '36th Floor',
  '37th Floor',
  '38th Floor',
  '39th Floor',
  '40th Floor',
  '41st Floor',
  '42nd Floor',
  '43rd Floor',
  '44th Floor',
  '45th Floor',
  '46th Floor',
  '47th Floor',
  '48th Floor',
  '49th Floor',
  '50th Floor'
];

const ComparePrediction = () => {
  const [activeTab, setActiveTab] = useState('compare-predictions');
  const [showProfileDropdown, setShowProfileDropdown] = useState(false);
  const [mapInstance, setMapInstance] = useState(null);
  const [markers, setMarkers] = useState([]);
  const [addedProperties, setAddedProperties] = useState([]);
  
  // Form state
  const [propertyType, setPropertyType] = useState('');
  const [propertyAddress, setPropertyAddress] = useState('');
  const [floorArea, setFloorArea] = useState('');
  const [level, setLevel] = useState('');
  const [unit, setUnit] = useState('');
  
  const navigate = useNavigate();
  const mapRef = useRef(null);
  const autocompleteRef = useRef(null);

  // Get user type from localStorage
  const userType = localStorage.getItem('userType') || 'free';

  // Initialize Google Maps
  useEffect(() => {
    const initMap = async () => {
      try {
        await loadGoogleMaps(GOOGLE_MAPS_API_KEY);
        
        if (mapRef.current && !mapInstance) {
          const map = new window.google.maps.Map(mapRef.current, {
            center: DEFAULT_CENTER,
            zoom: 11,
            mapTypeId: window.google.maps.MapTypeId.ROADMAP,
            styles: [
              {
                featureType: 'poi',
                elementType: 'labels',
                stylers: [{ visibility: 'off' }]
              }
            ]
          });
          
          setMapInstance(map);
        }
      } catch (error) {
        console.error('Error loading Google Maps:', error);
      }
    };

    initMap();
  }, [mapInstance]);

  // Initialize autocomplete for address search
  useEffect(() => {
    if (window.google && window.google.maps && mapInstance) {
      const input = document.getElementById('property-address-input');
      if (input && !autocompleteRef.current) {
        autocompleteRef.current = new window.google.maps.places.Autocomplete(input, {
          componentRestrictions: { country: 'sg' },
          fields: ['formatted_address', 'geometry', 'place_id']
        });

        autocompleteRef.current.addListener('place_changed', () => {
          const place = autocompleteRef.current.getPlace();
          if (place.geometry) {
            setPropertyAddress(place.formatted_address);
            
            // Update map center
            mapInstance.setCenter(place.geometry.location);
            mapInstance.setZoom(15);
            
            // Add marker for the selected location
            addMarker(place.geometry.location, place.formatted_address);
          }
        });
      }
    }
  }, [mapInstance]);

  const addMarker = (position, address) => {
    if (window.google && mapInstance) {
      const marker = new window.google.maps.Marker({
        position: position,
        map: mapInstance,
        title: address,
        animation: window.google.maps.Animation.DROP
      });

      const infoWindow = new window.google.maps.InfoWindow({
        content: `<div style="padding: 8px;"><strong>${address}</strong></div>`
      });

      marker.addListener('click', () => {
        infoWindow.open(mapInstance, marker);
      });

      setMarkers(prev => [...prev, marker]);
    }
  };

  const handleAddProperty = () => {
    if (!propertyType || !propertyAddress || !floorArea || !level) {
      alert('Please fill in all required fields');
      return;
    }

    const newProperty = {
      id: Date.now(),
      propertyType,
      address: propertyAddress,
      floorArea,
      level,
      unit: unit || 'N/A'
    };

    setAddedProperties(prev => [...prev, newProperty]);
    
    // Clear form
    setPropertyType('');
    setPropertyAddress('');
    setFloorArea('');
    setLevel('');
    setUnit('');
  };

  const handleRemoveProperty = (propertyId) => {
    setAddedProperties(prev => prev.filter(prop => prop.id !== propertyId));
    
    // Remove corresponding marker
    if (markers.length > 0) {
      const markerToRemove = markers[markers.length - 1];
      markerToRemove.setMap(null);
      setMarkers(prev => prev.slice(0, -1));
    }
  };

  const handleCompare = () => {
    if (addedProperties.length < 2) {
      alert('Please add at least 2 properties to compare');
      return;
    }
    
    // Navigate to comparison results page
    navigate('/dashboard/compare-results', { 
      state: { properties: addedProperties } 
    });
  };

  return (
    <div className="compare-prediction-dashboard">
      <Header />
      <div className="dashboard-content">
        <Navbar />
        <div className="main-content">
          <div className="compare-prediction-container">
            <h1 className="page-title">Compare Predictions</h1>
            
            <div className="select-properties-section">
              <h2 className="section-title">Select Properties</h2>
              
              <div className="form-row">
                <div className="form-group">
                  <label htmlFor="property-type">Property Type</label>
                  <select
                    id="property-type"
                    value={propertyType}
                    onChange={(e) => setPropertyType(e.target.value)}
                    className="form-select"
                  >
                    <option value="">Select Property Type</option>
                    {PROPERTY_TYPES.map(type => (
                      <option key={type} value={type}>{type}</option>
                    ))}
                  </select>
                </div>
                
                <div className="form-group address-group">
                  <label htmlFor="property-address-input">Property Address</label>
                  <input
                    id="property-address-input"
                    type="text"
                    value={propertyAddress}
                    onChange={(e) => setPropertyAddress(e.target.value)}
                    placeholder="Search by address"
                    className="form-input"
                  />
                </div>
              </div>

              <div className="form-row">
                <div className="form-group">
                  <label htmlFor="floor-area">Floor Area (sq ft)</label>
                  <input
                    id="floor-area"
                    type="text"
                    value={floorArea}
                    onChange={(e) => setFloorArea(e.target.value)}
                    placeholder="Enter floor area"
                    className="form-input"
                  />
                </div>
                
                <div className="form-group">
                  <label htmlFor="level">Level</label>
                  <select
                    id="level"
                    value={level}
                    onChange={(e) => setLevel(e.target.value)}
                    className="form-select"
                  >
                    <option value="">Select level</option>
                    {LEVEL_OPTIONS.map(level => (
                      <option key={level} value={level}>{level}</option>
                    ))}
                  </select>
                </div>
                
                <div className="form-group">
                  <label htmlFor="unit">Unit</label>
                  <input
                    id="unit"
                    type="text"
                    value={unit}
                    onChange={(e) => setUnit(e.target.value)}
                    placeholder="Enter unit number"
                    className="form-input"
                  />
                </div>
              </div>

              <button 
                className="add-property-btn"
                onClick={handleAddProperty}
              >
                Add Property
              </button>
              
              {addedProperties.length > 0 && (
                <div className="properties-count">
                  {addedProperties.length} propert{addedProperties.length === 1 ? 'y' : 'ies'} added
                </div>
              )}
            </div>

            <div className="map-section">
              <div ref={mapRef} className="map-container"></div>
            </div>

            <div className="compare-section">
              <button 
                className="compare-btn"
                onClick={handleCompare}
                disabled={addedProperties.length < 2}
              >
                Compare
              </button>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default ComparePrediction;
